css:
@-moz-document domain("debian.org") {
html, body, h1, h2, h3, h4, h5, h6,
 th, tr, td, tt, table, p, li,
 #footer,
 #inner,
 #logo,
 #main,
 #maincol,
 #outer,
 #breadcrumbs, #pnavbar
  {
    background: none !important;
    background-color: #222 !important;
    color: #ccc !important;
    font: normal 100% sans-serif;
  }

body > div.book, body > div.article, body > div.set, body > div.preface, body > div.chapter, body > div.section, body > div.appendix, body > div.part, body > div.index {
    background-color: #222;
}

div.panel {
    border-color: #aaa;
}

  em, code, kbd, .programlisting, pre, pre.screen, var, tt.backtick {
    background-color: #555;
    color: #ccf;
    font-family: monospace;
  }

  div.codearea, div.tip, div.important, div.warning, div.note, p.trans-note, .perror {
    background-color: #222;
  }

  span.keyword, .systemitem {
    color: #ccf;
  }

 h1 ~ table td > img
  {
    display: none !important;
  }

 a:hover   { background: #333 !important; }
 a:link    { color: #099 !important; }
 a:visited { color: #09C !important; }

 button, input, select, textarea 
  {
    color: #bbb !important;
    background: #444 !important;
    border: 1px solid #777 !important;
  }
/* ==================================*/
  p.section { background-color: #700; color: yellow; }

  #psearchsug,img[src="./Pics/reddot.png"],img[src="../Pics/reddot.png"] {
	 background-image: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAIAAAABCAYAAAD0In+KAAAAEUlEQVQI12NgSEv7z8DAwAAACjIBzGmpvZMAAAAASUVORK5CYII=);
  }
  /* package view */
  .vcurrent {
	 background-color: #111;
  }
  /* planet.debian.org */
  .channel {
	 background-color: #333;
	 border-color: #777;
  }
/* ==================================*/
/* COMMON RADIO AND CHECKBOX STYLES  */
input[type=radio],
input[type=checkbox]{
  /* Hide original inputs */
  visibility: hidden;
  position: absolute;
}
input[type=radio] + label:before,
input[type=checkbox] + label:before{
  height:12px;
  width:12px;
  margin-right: 2px;
  content: " ";
  display:inline-block;
  vertical-align: baseline;
  border:1px solid #777;
}
input[type=radio]:checked + label:before,
input[type=checkbox]:checked + label:before{
  background:#099;
}
/* CUSTOM RADIO AND CHECKBOX STYLES */
input[type=radio] + label:before{
  border-radius:50%;
}
input[type=checkbox] + label:before{
  border-radius:2px;
}
/* ==================================*/
 img[src="./logos/openlogo-nd-50.png"],
 img[src="../logos/openlogo-nd-50.png"],
 #logo img[width="50"][height="61"],
 img[src="http://www.debian.org/logos/openlogo-nd-50.png"]
  {
    background: url(data:image/png;base64,) !important;
    height: 0 !important;
    padding-left: 50px !important;
    padding-top: 62px !important;
    width: 0 !important;
  }
 img[src="Pics/debian.png"],
 img[src="../Pics/debian.png"],
 #logo img[width="179"][height="61"],
 img[src="http://www.debian.org/Pics/debian.jpg"]
  {
    background: url(data:image/png;base64,) !important;
    height: 0 !important;
    padding-left: 179px !important;
    padding-top: 61px !important;
    width: 0 !important;
  }

 #leftcol
  {
    background: #333 !important;
    border: 1px solid #555 !important;
    border-radius: 5px !important;
  }
 #leftcol > ul > li > a
  {
    color: #ddd !important;
    padding: 3px 2px !important;
  }
 #leftcol > ul > li > ul > li > a
  {
    color: #aaa !important;
    padding: 3px 2px !important;
  }
 #leftcol a:hover
  {
    background: #000 !important;
    border: 1px solid #777 !important;
    color: #fff !important;
    padding: 2px 1px !important;
    border-radius: 3px !important;
  }
 #navbar,
 h1 ~ table
  {
    background: #333 !important;
    border: 1px solid #555 !important;
    border-radius: 5px !important;
  }
 #navbar > ul > li > a,
 h1 ~ table td > a > img
  {
    background: #555 !important;
    border: 1px solid #777 !important;
    color: #ccc !important;
    border-radius: 5px !important;
  }
 #navbar a:hover,
 h1 ~ table td > a:hover > img
  {
    background: #222 !important;
    color: #fff !important;
  }

 .reltable th,
 .card div
  {
    background: #333 !important;
    color: #bbb !important;
  }
 .reltable .even,
 .cardleft div
  {
    background: #666 !important;
    color: #fff !important;
  }
 .reltable .odd,
 .cardright div
  {
    background: #999 !important;
    color: #000 !important;
  }
 .reltable a:link
  {
    color: #000066 !important;
  }
}
